// src/components/InvoicePage.js

import React, { useEffect, useState } from 'react';
import './InvoicePage.css'; // Create this file for styling the page

function InvoicePage() {
  const [userDetails, setUserDetails] = useState({});
  const [orderDetails, setOrderDetails] = useState([]);

  useEffect(() => {
    // Here, fetch user and order details from the server or use props/context
    // For example, using static data for demonstration:
    const userData = {
      firstName: 'John',
      lastName: 'Doe',
      gender: 'Male',
      age: 30,
      email: 'john.doe@example.com',
      address: '123 Main St, City, Country',
      company: 'ABC Corp',
      phone: '123-456-7890',
    };

    const orderData = [
      { productName: 'Product 1', quantity: 2, price: 50 },
      { productName: 'Product 2', quantity: 1, price: 100 },
    ];

    setUserDetails(userData);
    setOrderDetails(orderData);
  }, []);

  return (
    <div className="invoice-page">
      <h2>Invoice</h2>

      {/* User Details Section */}
      <div className="user-details">
        <h3>User Details</h3>
        <p><strong>First Name:</strong> {userDetails.firstName}</p>
        <p><strong>Last Name:</strong> {userDetails.lastName}</p>
        <p><strong>Gender:</strong> {userDetails.gender}</p>
        <p><strong>Age:</strong> {userDetails.age}</p>
        <p><strong>Email:</strong> {userDetails.email}</p>
        <p><strong>Address:</strong> {userDetails.address}</p>
        <p><strong>Company:</strong> {userDetails.company}</p>
        <p><strong>Phone:</strong> {userDetails.phone}</p>
      </div>

      {/* Order Details Section */}
      <div className="order-details">
        <h3>Order Details</h3>
        <table className="order-table">
          <thead>
            <tr>
              <th>Product Name</th>
              <th>Quantity</th>
              <th>Price</th>
              <th>Total</th>
            </tr>
          </thead>
          <tbody>
            {orderDetails.map((order, index) => (
              <tr key={index}>
                <td>{order.productName}</td>
                <td>{order.quantity}</td>
                <td>${order.price.toFixed(2)}</td>
                <td>${(order.quantity * order.price).toFixed(2)}</td>
              </tr>
            ))}
          </tbody>
        </table>
        {/* Calculating total order amount */}
        <p className="total-amount">
          <strong>Total Amount: </strong>$
          {orderDetails.reduce((acc, item) => acc + item.quantity * item.price, 0).toFixed(2)}
        </p>
      </div>
    </div>
  );
}

export default InvoicePage;
